        </view>

        <!-- 奖品主体 -->
        <view class="prize-body">
			 <image src="https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/product-default.png" class="prize-body-image" mode="aspectFit" />
			 <view class="product-img">
			 	<image src="/static/1.png" mode="aspectFit" lazy-load="true" class="product-iamge"></image>
			 </view>
			 <view class="product-count">
			 	x1
			 </view>
			 <view class="product-level">A赏</view>
        </view>

        <!-- 操作按钮组 -->
        <view class="action-buttons">
          <button class="btn shipping" @tap="handleShipping">去发货</button>
          <button class="btn view-detail" @tap="handleViewDetail">查看</button>
        </view>
		
		<view class="close-icon" @tap="closePopup">
		</view>

        <!-- 隐藏彩蛋区域 -->
        <image src="https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/fire.gif" mode="aspectFit" class="fire-gif"></image>
      </view>
    </view>
	<!-- 购买成功弹窗 -->
	<view v-if="showMorePopup" class="popup-more-mask" catchtouchmove>
	  <view class="popup-container" @tap.stop>
	
	    <!-- 奖品主体 -->
	    <view class="prize-body">
			<view class="product-cantent">
				<view class="product-card" v-for="item in showDrawInfo" :key="item.productId">
					<view class="series-qty">x1</view>
					<image :src="item.productImage" mode="aspectFit" lazy-load="true" class="product-iamge"></image>
					<view class="soul-power-content">
						+1魂力值
					</view>
					<view class="series-level">
						{{item.levelName}}
					</view>
					<view class="service-name">
						{{item.productName}}
					</view>
				</view>
			</view>
			
	    </view>
	
	    <!-- 操作按钮组 -->
	    <view class="action-buttons">
	      <button class="btn shipping" @tap="handleShipping">去发货</button>
	      <button class="btn view-detail" @tap="handleViewDetail">查看</button>
	    </view>
		
		<view class="close-icon" @tap="closePopup">
		</view>
	  </view>
	</view>
  </view>
</template>

<script>
export default {
	props:{
		dialogVisiable: {
		  type: Boolean,
		  default: false
		},
		dialogMoreVisible: {
		  type: Boolean,
		  default: false
		},
		drawInfos:{
			type: Array,
			default: ()=> {
				return []
			}
		}
	},
	watch:{
		dialogVisiable: {
			immediate: true,
			handler(newVal) {
				this.showPopup = newVal;
			}
		},
		dialogMoreVisible:{
			immediate: true,
			handler(newVal) {
				this.showMorePopup = newVal;
			}
		},
		drawInfos:{
			immediate: true,
			handler(newVal) {
				// this.showMorePopup = newVal;
				this.showDrawInfo = this.drawInfos.slice(0,2)
			}
		}
	},
  data() {
    return {
      showPopup: false,
	  showMorePopup:false,
      eggClickCount: 0,
      animationData: {},
      isEggActivated: false,
	  showDrawInfo: []
    }
  },
  methods: {
    // 显示弹窗
    showSuccessPopup() {
      this.showPopup = true
      uni.vibrateShort()
    },

    // 关闭弹窗
    closePopup() {
      this.showPopup = false
	  this.showMorePopup = false;
	  this.$emit("closeDialog",false)
      this.resetEgg()
    },

    // 处理发货操作
    handleShipping() {
      uni.switchTab({
      	url:"/pages/box/index"
      })
    },

    // 处理查看详情
    handleViewDetail() {
      this.$emit('openRecord')
    },

    // 彩蛋点击处理
    handleEggClick() {
      if (this.isEggActivated) return
      
      this.eggClickCount++
      if (this.eggClickCount >= 3) {
        this.triggerEggEffect()
      }
    },

    // 触发彩蛋效果
    async triggerEggEffect() {
      this.isEggActivated = true
      await this.playEggAnimation()
    },

    // 执行彩蛋动画
    playEggAnimation() {
      return new Promise(resolve => {
        const animation = uni.createAnimation({
          duration: 800,
          timingFunction: 'ease-out'
        })
        
        animation.opacity(0.5)
          .scale(1.5)
          .rotate(360)
          .step()
        
        this.animationData = animation.export()
        
        setTimeout(() => {
          animation.opacity(0).scale(0).step()
          this.animationData = animation.export()
          resolve()
        }, 800)
      })
    },

    // 重置彩蛋状态
    resetEgg() {
      this.eggClickCount = 0
      this.isEggActivated = false
      this.animationData = {}
    }
  }
}
</script>

